(1, 'Stats', 'Stats', 'Statistics Lab', 'Master the fundamentals of descriptive statistics. Analyze datasets, calculate variance and regression, and visualize distributions with interactive charts designed for classroom demonstrations.', 'fa-solid fa-chart-simple', 'blue', 10, 1, '2026-01-12 13:11:01', '2026-01-12 13:24:39'),
(2, 'Linear', 'Linear', 'Linear Studio', 'Explore linear data structures like Stacks, Queues, and Linked Lists. Watch operations like Push, Pop, and Enqueue happen in real-time to build a solid foundation in computer science.', 'fa-solid fa-layer-group', 'green', 20, 1, '2026-01-12 13:11:01', '2026-01-12 13:11:01'),
